import React from 'react';
import Filter from "./Filter"

const Filters = (props) => {

return (
    <span>
    <h2>FILTERS</h2>
    {props.filters.map((filter) => (
          <>
          <Filter
            label={filter.label}
            field={filter.field}
            values={filter.values}
          />
          </>
        ))}
    </span>
)

}

export default Filters;
